import { createSlice } from "@reduxjs/toolkit";
const initialState = {
  title: "",
  price: "",
  description: "",
  image: null,
};

export const newProductSlice = createSlice({
  name: "newProduct",
  initialState,
  reducers: {
    setForm: (state, actions) => {},
  },
});

export const { setForm } = newProductSlice.actions;

export default newProductSlice.reducer;
